import React from 'react';
import clsx from 'clsx';
import { makeStyles, useMediaQuery, useTheme, AppBar, CssBaseline, Toolbar } from '@material-ui/core';

import { drawerWidth } from './../../store/constant';
import Header from './Header';
import Sidebar from './Sidebar';
import './Sidebar.css';
import { FaLayerGroup,FaList,FaPhoneAlt,FaImage,FaUserAlt,FaUsers,FaLockOpen,FaLock } from "react-icons/fa";

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
    },
    appBar: {
        transition: theme.transitions.create('width'),
        [theme.breakpoints.up('md')]: {
            width: `calc(100% - ${drawerWidth}px)`,
            marginLeft: drawerWidth,
        },
    },
    toolbar: theme.mixins.toolbar,
    content: {
        width: '100%',
        minHeight: '100vh',
        flexGrow: 1,
        /*padding: theme.spacing(3),*/
        transition: theme.transitions.create('margin', {
            easing: theme.transitions.easing.sharp,
            duration: theme.transitions.duration.leavingScreen,
        }),
        [theme.breakpoints.up('md')]: {
            marginLeft: -drawerWidth,
            width: `calc(100% - ${drawerWidth}px)`,
        },
    },
    contentShift: {
        transition: theme.transitions.create('margin', {
            easing: theme.transitions.easing.easeOut,
            duration: theme.transitions.duration.enteringScreen,
        }),
        marginLeft: 0,
    },
    main: {
        padding: theme.spacing(5),
        [theme.breakpoints.down('sm')]: {
            padding: theme.spacing(3),
        },
    },
    header: {
        zIndex: 1201,
    },
}));

const MainLayout = ({ children }) => {
    const classes = useStyles();
    const theme = useTheme();
    const matchUpMd = useMediaQuery(theme.breakpoints.up('md'));
    const [drawerOpen, setDrawerOpen] = React.useState(false);

    const handleDrawerToggle = () => {
        setDrawerOpen(!drawerOpen);
    };

    React.useEffect(() => {
        setDrawerOpen(matchUpMd);
    }, [matchUpMd]);

        const menuItem=[

            {
                path:"http://localhost:3001/materially/dashboard/default",
                name:"Dashboard",
                icon:<FaLayerGroup/>

            },
            {
                path:"http://127.0.0.1:4000",
                name:"Detect Items",
                icon:<FaList/>

            },
            {
                path:"/displaydata",
                name:" All Items",
                icon:<FaList/>
             },
             {
                path:"/home",
                name:"New Items",
                icon:<FaList/>

            },

            {
                path:"/multiplegallery",
                name:"Old Items",
                icon:<FaList/>

            },

            // {
            //     path:"/contact",
            //     name:"Contact Us",
            //     icon:<FaPhoneAlt/>

            // },
            // {
            //     path:"/register",
            //     name:"Register",
            //     icon:<FaUserAlt/>
            // },
            // {
            //     path:"/login",
            //     name:"Login",
            //     icon:<FaLockOpen/>
            // },
            <br/>,<br/>,<br/>,<br/>,<br/>,<br/>,<br/>,<br/>,
            {
                path:"/",
                name:"Logout",
                icon:<FaLock/>
            }


        ];
    return (
        <div className={classes.root}>
            <CssBaseline />

            <AppBar position="fixed" className={classes.header} style={{ backgroundColor: '#ffffff' }}>
                <Toolbar>
                    <Header drawerOpen={drawerOpen} drawerToggle={handleDrawerToggle} />
                </Toolbar>
            </AppBar>
            <div className="container">
      <div style={{ "200px" : "40px"}} className="sidebar">
        <div className="top_section">
        <img src="../edgeforce.jpg" alt=" " width="250" height="50"/>
        </div>

        {
            menuItem.map((item,index)=>(
                <a href={item.path} key={index} className="link" activeclassName="active">
                    <div className="icon">{item.icon}</div>
                    <div style={{ "block" : "none"}} className="link_text">{item.name}</div>
                </a>
            ))
        }
      </div>


            {/* <Sidebar drawerOpen={drawerOpen} drawerToggle={handleDrawerToggle} /> */}
            <main className={clsx(classes.content, { [classes.contentShift]: drawerOpen })}>
                <div className={classes.toolbar} />
                <div className={classes.main}>{children}</div>
            </main>
        </div>
        </div>
    );
};

export default MainLayout;
